import React,{useState,useEffect} from 'react';
import axios from 'axios';
import './css/style.css';
import mars from '../Images/mars.png';
import lost from '../Images/lost.svg';
import wave from '../Images/wave.svg';

const SignUp=()=>{
	const [name,setname]=useState("");
	const [email,setEmail]=useState("");
	const [pass,setPass]=useState("");

const signup=(e)=>{
	    e.preventDefault();
	try{
		 axios.post("http://localhost:2000/auth/signUp",{
			name:name,
			email:email,
			password:pass
		}).then((response)=>{
		if(response){
		const elem=document.getElementById("register");
		elem.style.display="block";
		document.getElementById("container").style.display="none";
		document.querySelector("#wave").style.display="none";

		}
		})
		.catch((err)=>{
			console.log(err);
		})

	}catch(e){
		console.log(e);
	}
}
	return(
		<div className="main">
		<div className="container" id="container">

<div className="container__desc">
<img src={lost} alt="Ycrx-Image"/>
</div>

<div className="container__form">
<div  >
<div className="container__form__flex">
   <img src={mars} alt="Ycrx-Image"/>
 <h3 class="uk-card-title"className="container__form__text">Mars Form</h3>
   </div>
     <form onSubmit={signup}>
	<input type="text"  onChange={(e)=>{setname(e.target.value)}} required   placeholder="example" autofocus/>
	<input type="email" onChange={(e)=>{setEmail(e.target.value)}} required placeholder="example@gmail.com"/>
	<input type="password"  onChange={(e)=>{setPass(e.target.value)}} pattern=".{8,12}" title="8 to 12 characters" required placeholder="12345678"/>
	<button type="submit" onSubmit={signup}>Submit</button>
</form> 
</div>
</div>
		</div>
		<img className="wave" src={wave}/>
 		<h1 id="register">Sucessfull registered</h1>

		</div>
		);
}
export default SignUp;
